import { createSlice } from '@reduxjs/toolkit';

const epidemicDataAnalyseSlice = createSlice({
    name: 'EpidemicDataAnalyse',
    initialState: {
        data: [{
            province_id: 0,
            province_name: '',
            population: 0,
            population_density: 0,
            level: 0,
            infection_new: 0,
            infection_total: 0,
            infection_average: 0,
            recovered_new: 0,
            recovered_total: 0,
            recovered_average: 0,
            death_new: 0,
            death_total: 0,
            death_average: 0,
        }],
    },
    reducers: {
        changeEpidemicData: (state, action) => {
            state.data = action.payload.data;
        },
    },
});

export const { changeEpidemicData, } = epidemicDataAnalyseSlice.actions;
export default epidemicDataAnalyseSlice.reducer;
